export default function FileInput() {
    return (
        <div>
            <form onSubmit={this.handleSubmit}>
                <label>Upload file:
                    <input type="file" ref={this.fileInput} />
                </label>
                <br />
            <button type="submit">Submit</button>
            </form>
        </div>
    )
}
